import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import { NavLink } from 'react-router-dom';
import Logo from './Logo'; // Importa el componente Logo

function Header() {
  return (
    <Navbar bg="primary" variant="light" expand="lg">
      <Navbar.Brand as={NavLink} to="/">
        <Logo /> 
        <span className="app-name">CyberGuard</span> 
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <Nav.Link as={NavLink} to="/form" className="nav-link-custom" activeClassName="active">
            Formulario
          </Nav.Link>
        </Nav>
        <Nav>
          <Nav.Link as={NavLink} to="/login" className="nav-link-custom" activeClassName="active">
            Iniciar sesi√≥n
          </Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default Header;
